--Proporciona una consulta que muestre el Total de la Factura, nombre del cliente, país y nombre del Agente de Ventas para todas las facturas y clientes.

select c.FirstName, c.LastName, e.Country, e.FirstName, e.LastName, i.total from customers c, employees e JOIN invoices i ON e.EmployeeID = c.SupportRepid and c.CustomerID = i.CustomerID; 
