--Proporciona una consulta que muestre el número total de pistas en cada lista de reproducción. El nombre de la lista de reproducción debe estar incluido en la tabla resultante.
select p.name, COUNT(t.TrackId) AS total_num from playlist_track pt, tracks t JOIN playlists p ON pt.playlistId = p.playlistId and pt.trackId = t.trackId GROUP BY p.PlaylistId;
select p.name, COUNT(t.TrackId) AS total_num from playlist_track pt, tracks t, playlists p WHERE pt.playlistId = p.playlistId and pt.trackId = t.trackId GROUP BY p.PlaylistId;

